import React, { useState } from 'react';

const PlayerList = () => {
    const [formData, setFormData] = useState({
        teamWhite: Array(6).fill(''),
        teamBlack: Array(6).fill(''),
    });

    const handlePlayerNameChange = (team, index, newName) => {
        setFormData((prevData) => {
            const updatedData = { ...prevData };
            updatedData[team][index] = newName;
            return updatedData;
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Do something with the form data, e.g., send it to a server or display it.
        console.log('Form Data:', formData);
    };

    return (
        <div>
            <h2>Team Form</h2>
            <form onSubmit={handleSubmit}>
                <div className="team">
                    <h3>Team White</h3>
                    {formData.teamWhite.map((playerName, index) => (
                        <input
                            key={index}
                            type="text"
                            value={playerName}
                            onChange={(e) => handlePlayerNameChange('teamWhite', index, e.target.value)}
                            placeholder={`Player ${index + 1}`}
                        />
                    ))}
                </div>
                <div className="team">
                    <h3>Team Black</h3>
                    {formData.teamBlack.map((playerName, index) => (
                        <input
                            key={index}
                            type="text"
                            value={playerName}
                            onChange={(e) => handlePlayerNameChange('teamBlack', index, e.target.value)}
                            placeholder={`Player ${index + 1}`}
                        />
                    ))}
                </div>
                <button type="submit">Submit</button>
            </form>
        </div>
    );
}

export default PlayerList;
